const Categories = () => {
  let categories = [
    "Все",
    "Мясные",
    "Вегетарианская",
    "Гриль",
    "Острые",
    "Закрытые",
  ];

  return (
    <div className="categories">
      <ul>{categories.map()}</ul>
    </div>
  );
};

export default Categories;
